description:
Outside Closer is a 2005 album by Hood. It was produced in Leeds and released on Domino Records. It is their sixth full-length
album.

1. &quot;Introduction&quot;
2. &quot;The Negatives...&quot;
3. &quot;Any Hopeful Thoughts Arrive&quot;
4. &quot;End of One Train Working&quot;
5. &quot;Winter 72&quot;
6. &quot;The Lost You&quot;
7. &quot;Still Rain Fell&quot;
8. &quot;L. Fading Hills&quot;
9. &quot;Closure&quot;
10. &quot;This Is It, Forever&quot;
